import React from 'react';
import './App.css';
import Main from './container/Main'
import AddNewDialog from "./components/AddNewDialog";
import AddNewAccountButton from "./components/AddNewAccountButton";

function App() {
    const [modalShow, setModalShow] = React.useState(false);

    return (
        <div className="App">
            <AddNewDialog show={modalShow}
                          onHide={() => setModalShow(false)}/>
            <AddNewAccountButton onClick={() => setModalShow(true)}/>

            {/*<Main></Main>*/}
        </div>
    );
}

export default App;
